import React, { Component } from 'react';
import SideItem from '../molecules/sideBar/SideItem';

class Sidebar extends Component {
    constructor(props) {
        super(props)
        this.sideItems = [
            {
                name: 'All',
                img: './/images/categories/all+fresh.webp',
                alt: 'all'
            }, {
                ame: 'Fresh Vegetables',
                img: './/images/categories/all+fresh.webp',
                alt: 'fresh vegetables'
            }
        ]
    }

    render() {
        return (
            <aside className='cat'>
                {
                    this.sideItems.map((item, index) => <SideItem key={index} item={item} index={index} /> )
                }
            </aside>
        )
    }
}

export default Sidebar
